import React from 'react'

const Suggestion = (props) => {

    return(
        <div>
            <ul>
                {props.results.data.length && props.results.data.map(item => (
                    <li key ={item.id} onClick = {() => props.showDetails(item.id)}>
                        {item.name}
                    </li>
                ))}
            </ul>
        </div>
        ) 
}

export default Suggestion
